DROP TABLE IF EXISTS `tb_logistics`;
CREATE TABLE `tb_logistics` (
  `ID` int(11) NOT NULL AUTO_INCREMENT COMMENT '产品id',
  `CODE` varchar(10) NOT NULL COMMENT '燕文物流产品编码',
  `NAME` varchar(100) DEFAULT NULL COMMENT '燕文物流产品名称',
  `LOGISTICS_USER_ID` int(11) DEFAULT NULL COMMENT '无用',
  `LOGISTICS_TYPE` char(1) DEFAULT NULL COMMENT '物流类型 1.邮政 2.商业快递',
  `STAT` char(1) DEFAULT NULL,
  `DECLARE_AMOUNT` bigint(20) DEFAULT NULL COMMENT '提示金额',
  `APPROVE_STAT` char(1) DEFAULT NULL COMMENT '审核状态',
