  `TRACK` char(1) DEFAULT NULL COMMENT '是否可追踪 0:否 1.是',
  `MEMO` varchar(1000) DEFAULT NULL COMMENT '备注',
  `CREATE_TIME` datetime DEFAULT NULL,
  `CREATE_USER` int(11) DEFAULT NULL COMMENT '创建用户编号',
  `UPDATE_TIME` datetime DEFAULT NULL COMMENT '更新时间',
  `UPDATE_USER` int(11) DEFAULT NULL COMMENT '更新用户编号',
  `IS_DETELE` char(1) DEFAULT '0' COMMENT '是否删除',
  `MAX_WEIGHT` decimal(10,2) DEFAULT NULL COMMENT '限制最大重量',
  `LOGISTICS_CATEGORY` char(1) NOT NULL COMMENT '物流类型(0:中国小包;1:国际小包;2:大包;3:专线快递)',
  `BATTERY_TYPE` char(1) NOT NULL COMMENT '带电类型(0:不含电;1:内置;2:配套;3:纯电池)',
  `AREA` varchar(100) DEFAULT NULL COMMENT '物流可用区域',
  `DECLARE_CURRENCY` varchar(100) DEFAULT NULL COMMENT '提示金额币种',
  `DECLARE_WEIGHT` varchar(11) DEFAULT NULL COMMENT '提示重量,单位克',
  PRIMARY KEY (`ID`),
  KEY `IDX_LOGISTICS_ID_LOGISTICS_CODE` (`CODE`,`LOGISTICS_USER_ID`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=344 DEFAULT CHARSET=utf8;

